INSERT INTO `tcyy_company` VALUES ('1', '中国.重庆', '023-68789088', 'http://www.tianchiyueya.vip', '97306287 97306286  97306285 97306284 97306283 ', '/company/logo/20171118/560eed6c2309405be4f18df57304353d.jpg', '重庆坤源衡泰律师事务所-刘山川律师', '       天齿月牙健康咨询公司是由口腔业界精英 与四川美术学院一流设计师团队组建而成，以“打造牙科品牌，升级门诊形象，提升牙医价值”为宗旨的一家集牙科软件开发、牙科品牌设计、牙科企业全程推广业界权威设计公司。   公司软件设计部在重庆市九龙坡区IT企业孵化园A区113。本部设在艺术氛围浓厚的四川美术学院501艺术基地。我们是一家为牙科企业提供软件设计，牙科品牌升级、牙科品牌策划、牙科网站策划与设计、网络推广、装饰装修设计、等专业设计服务的高端美术设计机构。   随着科技的发展，品牌意识的普及，越来越多的牙科企业开始抢占先机，打造个性特色的牙科品牌。如何让自己管理更加便捷，与患者沟通更加有效，品牌效应更加明显，病人满意度提升到一个新的高度已经成为许多牙科品牌面临的一个难题。对于每个牙科品牌来说，提前抢占市场，就等同在同行中把握成功先机，领先一步同行一步，挖掘大量潜在客户，获得更大的发展机遇。   我公司拥有一支有资深行业经验、极富创意的团队，拥有丰富的运作经验与独到的设计见解，为远见卓识的朋友量身定做设计，为渴求发展的业界朋友打造崭新的品牌形象，我们为杰出的品牌准备了肥沃的土壤。在这里，策略、创意者都为最终的作品与效果负责，我们致力让每一个客户都感受到我们设计团队的睿智与活力。   同时我公司坚持视客户为伙伴，结合深具专业素养与快速反应的贴身服务，并秉承精诚的合作精神，贴心与客户谋发展，用心与客户共成长！', '天齿月牙健康咨询有限公司');
