DROP TABLE IF EXISTS `tcyy_advert`;
CREATE TABLE `tcyy_advert` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `image` varchar(255) NOT NULL COMMENT '图片链接地址',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `title` varchar(255) DEFAULT NULL COMMENT '图片标题',
  `status` tinyint(4) DEFAULT '1' COMMENT '1.启用  2.禁用  -1.删除',
  `url` varchar(255) DEFAULT NULL COMMENT '广告连接',
  PRIMARY KEY (`id`)
