-- ----------------------------
-- Table structure for tcyy_auth_rule
-- ----------------------------
DROP TABLE IF EXISTS `tcyy_auth_rule`;
CREATE TABLE `tcyy_auth_rule` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `name` char(80) NOT NULL DEFAULT '' COMMENT '认证规则 （index-index）',
  `title` char(20) NOT NULL DEFAULT '' COMMENT '规则描述',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '如果type为1， condition字段就可以定义规则表达式。 如定义{score}>5 and {score}<100 表示用户的分数在5-100之间时这条规则才会通过。（默认为1）',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1启用  2.禁用',
  `condition` char(100) NOT NULL DEFAULT '' COMMENT '当type为1时，condition字段里面的内容将会用作正则表达式的规则来配合认证规则来认证用户',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '上级ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 COMMENT='权限规则表';

-- ----------------------------
-- Records of tcyy_auth_rule
-- ----------------------------

