DROP TABLE IF EXISTS `tcyy_member`;
CREATE TABLE `tcyy_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL COMMENT '用户名',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `nickname` varchar(255) NOT NULL COMMENT '昵称',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机联系方式',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后一次登录时间',
  `last_login_ip` varchar(255) NOT NULL DEFAULT '0' COMMENT '最后一次登录IP',
  `login_count` int(11) NOT NULL DEFAULT '0' COMMENT '登录次数',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.启用  2.禁用  -1.删除',
  `reg_time` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `last_edit_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后一次操作时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
