-- Table structure for tcyy_point_config
-- ----------------------------
DROP TABLE IF EXISTS `tcyy_point_config`;
CREATE TABLE `tcyy_point_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `point` int(11) NOT NULL DEFAULT '0' COMMENT '加或者减多少分',
  `travel` int(11) NOT NULL DEFAULT '0' COMMENT '次数，每日记录多少次 有几分',
  `title` varchar(255) NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.启用  2.禁用 -1删除',
  `jj` tinyint(4) DEFAULT '1' COMMENT '1.加 2.减',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.固定  2.比例',
  `num` int(11) DEFAULT '0' COMMENT '数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='积分配置表';

