-- ----------------------------
-- Table structure for tcyy_user
-- ----------------------------
DROP TABLE IF EXISTS `tcyy_user`;
CREATE TABLE `tcyy_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(255) NOT NULL COMMENT '唯一标识码，每次登录都会不同，判断是否已经登录',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后一次登录时间',
  `last_login_ip` varchar(255) DEFAULT NULL COMMENT '最后一次登录IP',
  `reg_ip` varchar(255) NOT NULL COMMENT '注册IP',
  `login_count` int(11) NOT NULL DEFAULT '0' COMMENT '登录次数',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.正常 2.禁用 -1.删除',
  `is_login` tinyint(4) unsigned zerofill NOT NULL DEFAULT '0002' COMMENT '登录状态 1.登录 2.未登录',
  `phone` varchar(255) NOT NULL COMMENT '电话号码',
  `password` varchar(255) NOT NULL COMMENT '登录密码',
  `other_code` varchar(255) DEFAULT NULL COMMENT '第三方唯一标识（QQ 微信）',
  `login_type` tinyint(4) unsigned zerofill NOT NULL DEFAULT '0001' COMMENT '登录类型  1.手机登录，2.QQ登录  3.微信登录',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.普通  2.讲师',
  `is_vip` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.非VIP  2.VIP',
  `vip_end_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员到期时间',
  `total_point` int(11) NOT NULL DEFAULT '0' COMMENT '累计积分',
  `point` int(11) NOT NULL DEFAULT '0' COMMENT '剩余积分',
  `active_lv` int(11) unsigned zerofill NOT NULL DEFAULT '00000000000' COMMENT '活跃等级',
  `regtime` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `pushid` varchar(255) DEFAULT NULL COMMENT '推送ID',
  `spread_code` varchar(255) NOT NULL COMMENT '推广码',
  `top_spread_code` varchar(255) DEFAULT NULL COMMENT '上级推广码',
  `personnel` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1.求职者  2.招聘者（医院公司）',
  `systype` tinyint(4) NOT NULL DEFAULT '1' COMMENT '登录设备 1.安卓  2.苹果',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1851 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

-- ----------------------------
-- Records of tcyy_user
-- ----------------------------

